	private List<Stock> list = new ArrayList<>();
	
	public List<Stock> populateInvestingComRatings() {
		
		try
		{
			list = new ArrayList<>();
			String auto = appProp.getProperty("investing.com.rating.auto");
			if("Y".equalsIgnoreCase(auto))			
				processAuto();			
			else
				processManual();
		}
		catch(Exception ex)
		{
			System.err.println("ERROR ==> populateInvestingComRatings ==>" + ex);
		}
		updateLiveStock(list);
		return list;
	}
	
