	private void processManual() throws IOException
	{
		String folderName = appProp.getProperty("investing.com.rating.folder.name");

		// Use the class loader to access resources
		ClassLoader cl = this.getClass().getClassLoader();
		ResourcePatternResolver resolver = new PathMatchingResourcePatternResolver(cl);

		// Resolve resources using the folder name and ticker
		Resource[] resources = resolver.getResources(folderName);
		for (Resource resource : resources) {
			String json = "";				
			try (BufferedReader reader = new BufferedReader(new InputStreamReader(resource.getInputStream()))) {
				String line;
				while ((line = reader.readLine()) != null) {
					// Process each line from the file
					json = json + line;
				}
			}
			processResponse(json);				
		}
		System.out.println("11 - INVESTING.COM RATING DONE ==> MANUAL");
	}
	
	private void processResponse(String json) throws JsonMappingException, JsonProcessingException
	{
		if(StringUtils.isNotBlank(json))
		{
			ObjectMapper objectMapper = new ObjectMapper();
			JsonNode root = objectMapper.readTree(json);
			
			Iterator<String> fieldNames = root.fieldNames();
			while (fieldNames.hasNext()) {
				String assetName = fieldNames.next();
				// Loop through each asset
				JsonNode assetNode = root.get(assetName);
				if(assetNode != null)
				{
					Stock stock = new Stock();
					stock.setRating(new Rating());						
					stock.setTicker(assetName.split(":")[1]);
					double latestPrice = assetNode.get("asset_price_latest").asDouble();
					double targetUpside = assetNode.get("analyst_target_upside").asDouble();
					stock.getRating().setInvestComRating(UtilityService.getInvestingComRating(
							String.valueOf((assetNode.get("analyst_rec").asDouble()))));
					stock.getRating().setInvestComTarget(UtilityService.stripStringToTwoDecimals(
							String.valueOf((latestPrice * targetUpside) + latestPrice), false));
					list.add(stock);
				}
			}
		}
	}
	
	private void updateLiveStock(List<Stock> investComList)
	{
		stockServiceDB.populateLiveStockList();
		List<Stock> liveList = LiveStockCache.getLiveStockList();
		if(liveList != null && !liveList.isEmpty() && investComList != null && !investComList.isEmpty())
		{
			liveList.stream().forEach(stock -> {
				if (stock != null) {
					investComList.stream().filter(x -> x.getTicker().equalsIgnoreCase(stock.getTicker()))
					.findFirst() // Get the first matching element, if any
					.ifPresent(matchingElement -> {
						stock.getRating().setInvestComRating(matchingElement.getRating().getInvestComRating());						            						            
						stock.getRating().setInvestComTarget(matchingElement.getRating().getInvestComTarget());
					});
				}
			});
		}
	}
